import React from "react";
import { MDBCarousel,MDBMask,MDBCarouselCaption, MDBCarouselInner, MDBCarouselItem, MDBView, MDBContainer } from
"mdbreact";

const CarouselPage = ({products}) => {
  return (
    <MDBContainer>
      <MDBCarousel
        activeItem={1}
        length={3}
        showControls={true}
        showIndicators={false}
        className="z-depth-1"
        slide
      >
              <MDBCarouselInner>
                  {products.map((products,i) => (
          <MDBCarouselItem itemId="1">
            <MDBView>
              <img
                className="d-block w-100"
                src={`http://localhost:3000/${products.photo[i].path}`}
                alt="First slide"
                          />
                          
          <MDBMask overlay="black-light" />
             </MDBView>
            <MDBCarouselCaption>
            <h3 className="h3-responsive">Light mask</h3>
            <p>First text</p>
          </MDBCarouselCaption>
          </MDBCarouselItem>            
                  ))}
          
    
        </MDBCarouselInner>
      </MDBCarousel>
    </MDBContainer>
  );
}

export default CarouselPage;
